import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

//Auth Stuff
import {Provider} from "react-redux";
import store from "./Auth/store";


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Provider store={store}>
      <App />
    </Provider>
    
  </React.StrictMode>
);
